import React from 'react';
import service1 from './image/garage-service-1.jpg'
import service2 from './image/garage-service-2.jpg'
import service3 from './image/garage-service-3.jpg'

const Services = () => {
    return (
        <>
            <div>
                <h1 className="titreServices">Nos services</h1>
                <div className="services">
                    <p className="paragrapheService">Le service numéro 1</p>
                    <img src={service1} className="serviceGarage" />
                </div>
                <div className="services">
                    <img src={service2} className="serviceGarage" />
                    <p paragrapheService>Le service numéro 1</p>
                </div>
                <div className="services">
                    <p paragrapheService>Le service numéro 1</p>
                    <img src={service3} className="serviceGarage" />
                </div>
            </div>

        </>
    );
};

export default Services;
